/**
 * @file
 * A JavaScript file for the foot notes behavior
 */
(function($) {
  Drupal.behaviors.foot_notes = {};

  Drupal.behaviors.foot_notes.attach = function(context) {
    // Check that foot-notes are present in the page
    if ($('#footnotes-target').size() > 0) {
      $('a[href~="#footnotes"]').click( function(e) {
        e.preventDefault();
        // Get header's height:
        var header_height = ($('#zone-header-second').size()>0) ? $('#zone-header-second').height() : 0;
        // Add arrow height:
        header_height += ($('#zone-header-second #header-comma').size()>0) ? $('#zone-header-second #header-comma').outerHeight() : 0;
        // If header is not sticky, add again to header_height to ensure never overlap title,
        // even after if header be sticky on scroll:
        header_height += (!$('#zone-header-second').hasClass('sticky')) ? $('#zone-header-second').height() : 0;
        // Start animation:
        $('html,body').animate({
          'scrollTop': $("#footnotes-target").offset().top - header_height
        }, 1000);
      });
    }
  };

})(jQuery);;
