/**
 * @file
 * A JavaScript file for add classes on tables
 */
(function($) {
  Drupal.behaviors.html_tables = {};

  Drupal.behaviors.html_tables.attach = function(context) {
    $('.paragraph-subcontent-text').find('table').each( function() {
      // Add even/odd class on rows
      $(this).find('tr:odd').addClass('odd');
      $(this).find('tr:even').addClass('even');
      // Ad classes on cells
      $(this).find('tr').each(function() {
        // Add even / odd class on cells
        $(this).find('td:odd').addClass('odd');
        $(this).find('td:even').addClass('even');
        
        // Add first, last on cells
        $(this).find('td').each(function(td_id) {
          if (td_id == 0) {
            $(this).addClass('first');
          }
          if ($(this).is(':last-child')) {
            $(this).addClass('last');
          }
        });
        // Add even / odd class on cells
        $(this).find('th:odd').addClass('odd');
        $(this).find('th:even').addClass('even');
        
        // Add first, last on cells
        $(this).find('th').each(function(td_id) {
          if (td_id == 0) {
            $(this).addClass('first');
          }
          if ($(this).is(':last-child')) {
            $(this).addClass('last');
          }
        });
      });
    });
  };

})(jQuery);;
